import React from 'react';
import { Link } from 'react-router-dom';
import "./Navbar.css";

function Navbar() {
  return (
    <nav>
      <Link to="/">Home</Link>
      <Link to="/login">Login</Link>
      <Link to="/stats">Stats</Link>
      <Link to="/timer">Timer</Link>
    </nav>
  );
}

export default Navbar;
